import './App.css';
import { Box } from '@mui/system';
import {
  BrowserRouter as Router,
  Route,
  Routes,
  Outlet,
  Link
} from "react-router-dom";

import Home from "./pages/Home";
import Blogs from "./pages/Blogs";
import About from "./pages/About";

const style = {
  textDecoration:'none',
  marginRight: 10,
  fontSize:25,
  color: 'black'
};

function App() {
  return (
    <div className="App">
      <Box component="section" sx={{ p: 3,marginBottom: '20px', border: '1px dashed grey',}}>
          <Router>
            <Routes>
              <Route path="/" element={<Layout/>}>
                <Route index element={<Home/>}/>
                <Route path="/blogs" element={<Blogs/>}/>
                <Route path="/about" element={<About/>}/>
              </Route>
            </Routes>
          </Router>
        </Box>
        <Outlet/>
    </div>
  );
}
const Layout = () => {
  return (
    <div>
      <Link to="/" style={style}>Home</Link>
      <Link to="/blogs" style={style}>Blogs</Link>
      <Link to="/about" style={style}>About</Link>
    </div>

  )
};
export default App;
